                <Route path="/Skincare" element={<Skincare />}></Route>
                <Route path="/Groceries" element={<Groceries />}></Route>
                <Route path="/Homedecoration" element={<Homedecoration />}></Route>
                <Route path="/Furniture" element={<Furniture />}></Route>
